import React from "react";
// import "./instructorCard.css";
import { Row } from "../Grid";
// import parisCard from "../../images/parisCard.png";
import { PromiseProvider } from "mongoose";
import mat from "../../images/mat.jpg";

const BestMatchCard = () => (
  <div className="instructor-row">
    <div className="instructor-card">
      <div className="card">
        <div className="waves-effect waves-block waves-light">
          <img className="instructor-image " src={mat} />
        </div>
        <div class="card-content instructor-name">
          <span className="card-title grey-text text-darken-4">
            {/* {props.name} */} Johnny Salke
            <i className="material-icons right">more_vert</i>
          </span>
        </div>
        <div className="card">
          <span className="card-title grey-text text-darken-4">
            Why I Teach<i className="material-icons right">close</i>
          </span>
          <p>
            {" "}
            "I teach because it brings me joy to witness my students striving
            for and reaching their goals.
          </p>
          {/* <p>{props.message}</p> */}
          <hr />
          <p>Name: Johnny Salke</p>
          <p>Studio: Clubville </p>
          <p>Location: San Luis Obispo, CA</p>

          <div>
            <a className="waves-effect waves-light btn-small right instructor-btn">
              View Profile
            </a>
          </div>
        </div>
      </div>
    </div>
  </div>
);

export default BestMatchCard;
